import { push } from 'connected-react-router'

  export const pageNav = ( searchParam, mediaType ) => {
      console.log(meidaType)
    return (dispatch) => {

        switch ( mediaType ) {

            case 'movie':
                dispatch(push(`/movie?Id=${searchParam}`))
                break;

            case 'tv':
                dispatch(push(`/tv?Id=${searchParam}`))
                break;

            case 'person':
                dispatch(push(`/person?Id=${searchParam}`)) 

                break;
            default:
                break;
        }

    };
  };
